caption:
I have been to the Sheikh Zayed Grand Mosque countless of times and I still catch myself in awe of its sheer size and grandeur. Truly an iconic Abu Dhabi destination where people from all over the world gather to appreciate the emirate’s heritage.

If you haven’t been, make it your next destination.

